import React from 'react';
import { NavLink } from 'react-router-dom';
import './AdvancedNavbar.css';

const AdvancedNavbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
        <div className="navbar-header">
          <NavLink className="navbar-brand" to="/">My App</NavLink>
        </div>
        <ul className="navbar-nav mr-auto">
          <li className="nav-item">
            <NavLink className="nav-link" to="/" activeClassName="active" exact>Home</NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" to="/shop" activeClassName="active">Shop</NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" to="/cart" activeClassName="active">Cart</NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" to="/about" activeClassName="active">About Us</NavLink>
          </li>
        </ul>
      </div>
    </nav>
  );
}

export default AdvancedNavbar;
